# Funcin para generar etiquetas para las imgenes
def generate_labels_for_images(images, model, processor):
    labels = []
    for image in images:
        show_image(image)

        prompt = """<|user|>\nEres un modelo de IA especializado en analizar imgenes relacionadas con protestas. Por favor, analiza la imagen basndote en su contenido y caractersticas. Utiliza los criterios proporcionados para evaluar y etiquetar cada aspecto.

  Criterios:
  Contenido de las Pancartas: Identifica el texto en las pancartas o carteles, incluso si la redaccin no es clara. Si no encuentras un sentido claro en la frase, trata de predecir lo que podra estar diciendo basndote en el contexto. Solo entrega el texto de la pancarta.
  Smbolos: Identifica smbolos como banderas, logotipos o iconos especficos.
  Elementos Adicionales: Describe cualquier otro elemento relevante (por ejemplo, multitudes, presencia policial).
  Descripcin General: Proporciona una descripcin general de la escena de la protesta.
  Por favor, analiza la imagen de la protesta proporcionada y completa unicamente el siguiente esquema JSON que se encuentra entre los apostrofos con tus observaciones y evaluaciones:

  '{
    "contenido_pancartas": "Tu evaluacin aqu",
    "simbolos": "Tu evaluacin aqu",
    "elementos_adicionales": "Tu evaluacin aqu",
    "descripcion_general": "Tu evaluacin aqu",
  }'

  <|image_1|>\n<|end|>\n<|assistant|>\n
  """

        inputs = processor(prompt, [image], return_tensors="pt").to("cuda")
        generation_args = {
              "max_new_tokens": 170,
              "temperature": 0.5,
              "top_k": 30,
              "top_p": 0.9,
              "do_sample": True,
        }
        generate_ids = model.generate(**inputs, eos_token_id=processor.tokenizer.eos_token_id, **generation_args)
        generate_ids = generate_ids[:, inputs['input_ids'].shape[1]:]
        response = processor.batch_decode(generate_ids, skip_special_tokens=True, clean_up_tokenization_spaces=False)[0]

        print(response)
        labels.append(response.strip())
    return labels

